import React, {Component} from 'react';
import axios from 'axios';
class App extends Component {

    state = {
        todos: []
    }

    componentWillMount() {
        axios.get('https://jsonplaceholder.typicode.com/todos').then((response) => {
            this.setState({
                todos: response.data
            })
        });
    }

    render() {

        let todos = this.state.todos.map((todo) => {
            return (
                <tr>
                    <th>{todo.id}</th>
                    <th>{todo.userId}</th>
                    <th>{todo.title}</th>
                    <th>{todo.completed}</th>
                    <th>
                        <button className="btn btn-danger"
                        onClick={this.deleteBook.bind()}>Delete</button>
                    </th>
                </tr>
            )
        });

        return (

            <div className="App container">
                <table>
                    <thead>
                    <tr>
                        <th>ID</th>
                        <th>User</th>
                        <th>Rating</th>
                        <th>Completed</th>
                        <th>Actions</th>
                    </tr>
                    </thead>
                    <tbody>
                    {todos}
                    </tbody>
                </table>
            </div>
        )
            ;
    }
}

export default App;
